export const navLinks = [
  { id: 'home', label: 'Home' },
  { id: 'about', label: 'About' },
  { id: 'services', label: 'Services' },
  { id: 'skills', label: 'Skills' },
  { id: 'projects', label: 'Projects' },
  { id: 'education', label: 'Education' },
  { id: 'contact', label: 'Contact' }
]

export const services = [
  { title: 'Software Development', desc: 'Full-stack web & mobile development using modern frameworks.' },
  { title: 'Software Testing', desc: 'Manual & automated testing with real project experience.' },
  { title: 'Android Development', desc: 'Java-based Android applications and UX-minded mobile features.' }
]

export const skills = {
  technical: ['HTML5','CSS3','JavaScript','Java','Python','MySQL'],
  soft: ['Communication','Teamwork','Networking','Time Management'],
  tools: ['Git','GitHub','Figma','Jira']
}

export const projects = [
  {
    id: 'srms',
    title: 'Student Result Management System',
    desc: 'Desktop SRMS built with Python & SQLite',
    img: '/SRMSlogo.png',
    url: 'https://github.com/KunalBagheleIT27/student-Managament-System-Using-Sqlite'
  },
  {
    id: 'collegespace',
    title: 'CollegeSpace',
    desc: 'Android app unifying college services.',
    img: '/CollegeSpaceLOGO.png',
    url: 'https://github.com/KunalBagheleIT27/CollegeSpace-AndriodApp'
  }
]

export const education = [
  { year: '2024 - 2027', title: 'Bachelor of Engineering', place: 'MMCOE, Pune', score: '9.0/10' },
  { year: '2021 - 2024', title: 'Diploma in Computer Engineering', place: 'G. P. Gondia (MSBTE)', score: '90.23%' },
  { year: '2021', title: 'SSC (10th Grade)', place: 'Maharashtra State Board', score: '89.20%' }
]
